import React, {useState} from 'react';
import AddUser from "./containers/addUser";
import UsersList from "./containers/usersList";

function App() {

    const [data, setData] = useState([]);

    return (
        <div>
            <AddUser />
            <UsersList data={data}/>
        </div>
    );
}

export default App;
